CREATE TABLE IF NOT EXISTS "web_issues" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject" varchar(80) NOT NULL, "desc" text NOT NULL, "priority" varchar(12) NOT NULL, "status" smallint NOT NULL, "start_date" date NULL, "end_date" date NULL, "create_datetime" datetime NOT NULL, "latest_update_datetime" datetime NOT NULL, "assign_id" integer NULL REFERENCES "web_userinfo" ("id"), "creator_id" integer NOT NULL REFERENCES "web_userinfo" ("id"), "module_id" integer NULL REFERENCES "web_module" ("id"), "project_id" integer NOT NULL REFERENCES "web_project" ("id"), "parent_id" integer NULL REFERENCES "web_issues" ("id"));
