CREATE TABLE IF NOT EXISTS "web_projectinvite" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(64) NOT NULL UNIQUE, "count" integer unsigned NULL, "use_count" integer unsigned NOT NULL, "period" integer NOT NULL, "create_datetime" datetime NOT NULL, "creator_id" integer NOT NULL REFERENCES "web_userinfo" ("id"), "project_id" integer NOT NULL REFERENCES "web_project" ("id"));
CREATE TABLE IF NOT EXISTS "web_transaction" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "order" varchar(64) NOT NULL UNIQUE, "price" integer NOT NULL, "start_datetime" datetime NULL, "end_datetime" datetime NULL, "create_datetime" datetime NOT NULL, "user_id" integer NOT NULL REFERENCES "web_userinfo" ("id"), "status" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "web_userinfo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(32) NOT NULL, "email" varchar(32) NOT NULL, "mobile_phone" varchar(32) NOT NULL, "password" varchar(32) NOT NULL, "asset" integer NOT NULL, "category" smallint NOT NULL, "latitude" real NOT NULL, "longitude" real NOT NULL, "reputation" real NOT NULL);
CREATE TABLE IF NOT EXISTS "web_projectuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "create_datetime" datetime NOT NULL, "project_id" integer NOT NULL REFERENCES "web_project" ("id"), "user_id" integer NOT NULL REFERENCES "web_userinfo" ("id"), "star" bool NOT NULL, "already" bool NOT NULL, "task_price" real NOT NULL);
CREATE TABLE IF NOT EXISTS "web_project" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(32) NOT NULL, "color" smallint NOT NULL, "desc" varchar(255) NULL, "use_space" integer NOT NULL, "star" bool NOT NULL, "join_count" smallint NOT NULL, "create_datetime" datetime NOT NULL, "creator_id" integer NOT NULL REFERENCES "web_userinfo" ("id"), "bucket" varchar(128) NOT NULL, "region" varchar(32) NOT NULL, "latitude" real NOT NULL, "longitude" real NOT NULL, "user_count" smallint NOT NULL, "grow" integer NOT NULL, "hard" integer NOT NULL, "location" varchar(255) NULL);
